import React from 'react';
import './App.css';
import {Link} from "react-router-dom" 


function Nav() {
  return (
    <nav> 
        <h3>Logo
            <ul  className = "nav-links">
                <Link>
                <li>
             About
            </li>
            </Link>
        <li>Shop</li>
       
            </ul>
         </h3>
     </nav>

  );
}

export default Nav;
